import { HTTP } from 'meteor/http'

Template.uiGenerateSDKModal.helpers({
    'languages' () {
        return languageList;
    }
});

Template.uiGenerateSDKModal.events({
    'click #download': function() {
        // HTTP.get("https://generator.swagger.io/api/gen/clients/ruby", function(err, result) { console.log(result)});
        HTTP.post("https://generator.swagger.io/api/gen/clients/ruby", 
            { data: {"swaggerUrl":"http://petstore.swagger.io/v2/swagger.json"}} ,
            function(err, result) { var temp = JSON.parse(result.content); window.location.href = temp.link; })
    }
})
